// @grant        none
// @downloadURL  https://github.com/nnmhuy/flight-radar-tampermonkey-scripts/raw/main/Alarm%20reminder.user.js
// @updateURL    https://github.com/nnmhuy/flight-radar-tampermonkey-scripts/raw/main/Alarm%20reminder.user.js
// ==/UserScript==


// test auto update
(function() {
    'use strict';
    var audio = new Audio('data:audio/mpeg;base64,')
    audio.crossOrigin = "anonymous"

    const alarmSound = () => {
        audio.play();
    }

    const alarm = (msg) => {
        alarmSound();
        if (!document.hidden) {
            alert(msg);
        }
    }


    // for every minute
    setInterval(() => {
        const date = new Date();
        let day = date.getDay();
        let hour = date.getHours();
        let minutes = date.getMinutes();

         // kim tra sng
        if (hour == 4 && minutes == 29) {
            alarm("Kng kim tra sng");
        }

        // bo thc sng (t2-t6: 5h30; t7, CN: 06h00)
        if (day == 0 || day == 6) {
            if (hour == 5 && minutes == 59) alarm("Kng bo thc");
        } else {
            if (hour == 5 && minutes == 29) alarm("Kng bo thc");
        }

        // bt u gi lm vic sng (t2-t7: 07h00)
        if (day != 0) {
            if (hour == 6 && minutes == 59) alarm("Kng bt u gi lm vic");
        }

        // ht gi lm vic sng (t2-t7: 11h00)
        if (day != 0) {
            if (hour == 10 && minutes == 59) alarm("Kng ht gi lm vic");
        }

        // bo thc chiu (t2-t6: 13h30; t7, CN: 14h00)
        if (day == 0 || day == 6) {
            if (hour == 13 && minutes == 59) alarm("Kng bo thc");
        } else {
            if (hour == 13 && minutes == 29) alarm("Kng bo thc");
        }

        // giao ban (t2-t5: 16h00; t6: 15h00)
        if (day >= 1 && day <= 4) {
            if (hour == 15 && minutes == 59) alarm("Kng giao ban");
        } else if (day == 5) {
            if (hour == 14 && minutes == 59) alarm("Kng giao ban");
        }

        // bt u gi lm vic chiu (t2-t6: 13h45)
        if (day >= 1 && day <= 5) {
            if (hour == 13 && minutes == 44) alarm("Kng bt u gi lm vic");
        }

        // ht gi lm vic chiu (t2-t6: 17h45)
        if (day >= 1 && day <= 5) {
            if (hour == 17 && minutes == 44) alarm("Kng ht gi lm vic");
        }

        // kng 19h00 cn,t2-t6
        if (day != 6) {
            if (hour == 18 && minutes == 59) alarm("Kng xem thi s");
        }

        // im danh/im qun s
        if (hour == 20 && minutes == 44) {
            alarm("Kng im danh/im qun s");
        }

        // ng
        if (hour == 21 && minutes == 29) {
            alarm("Kng ng");
        }
    }, 60000)
})();
